import React, {Component} from "react";

class ChangePassword extends Component {
    constructor(props) {
        super(props)
        this.state = {
            redirect: false
        }

        this.handleSubmit = this.handleSubmit.bind(this)
    }
    getAuth() {
        const user  = localStorage.getItem('user')
        const token = localStorage.getItem('token')

        const req = new FormData()
        req.append('user', user)
        req.append('token', token)

        apiservice.hasAuth(req).then((res) => {
            const auth = res.auth
            switch (auth) {
                case 'Visitor':
                    this.setState({ redirect : true })
                    break
                case 'User':
                    this.setState({ redirect : false })
                    break
                case 'Client':
                    this.setState({ redirect : false })
                    break
            }
        })
    }
    render() {
        return(
            <div class="container center">
                <div className="card amber darken-2 center-align">
                    <div className="card-title">
                        <h4>Mudar Senha</h4>
                    </div>
                    <form method="POST" encType="multipart/form-data" >
                        <div className="card-content white-text">
                            <div className="center">
                                <div className="row">
                                    <label for="input_text">Senha</label>
                                    <input id="input_text" type="password" ref="password" placeholder="********" />
                                </div>
                            </div>
                            <div className="center">
                                <div className="row">
                                    <label for="input_text">Confirmacao da nova senha</label>
                                    <input id="input_text" type="password" ref="passwordconfirm" placeholder="********" />
                                </div>
                            </div>
                        </div>
                        <div className="card-action">
                            <button type='submit' className="btn waves-effect waves-light orange darken-3">Mudar<i className="material-icons right">send</i></button>
                        </div>
                    </form>
                </div>
            </div>
        )
    }
}

export default ChangePassword;
